"""# Part 1 : Code WalkThrough

### Input Parsing Functions

The **get_hashgraph_input** function takes filename as the input and reads the file for HashGraph input line by line untill 'Done' is encountered. The first line of the input specifies number of nodes in the Hashgraph, and each of the subsequent line describes an event. The lines read are returned.


The **event_parser** function takes one line which is an event and extracts the required event fields from that line.
"""

def get_hashgraph_input(filename) :
  lines = []
  try:
    with open(filename, 'r') as f :
      while True:
        line = f.readline()
        if line.split()[0]=='Done' :
          break
        lines.append(line.split())
  except:
    raise 'Filename incorrect or Invalid Input File Format'

  return lines

def event_parser(line):
    creator = int(line[0])
    id = int(line[1])
    parent = -1
    if line[2].upper()!='NULL':
      parent = int(line[2])

    self_parent=-1
    if line[3].upper()!='NULL':
      self_parent = int(line[3])

    timestamp = int(line[4])
    return (creator, id , parent , self_parent, timestamp)

