"""## Helper functions and The Init Function for Hashgraph Class"""

# the __init__ function initializes the HashGraph Class, it creates the hashgraph
# by assigning the parent children relationships and also calls other helper which initializes
# other data structures required for consensus algorithm
def __init__(self , lines) :
  self.number_of_nodes = int(lines[0][0])
  self.number_of_events = len(lines)-1
  self.majority_number = int(math.floor(1 + ((2*self.number_of_nodes)/3)))

  self.events = {}
  # parse all events, and create the event objects
  for i in range(1,len(lines)) :
    parsed_event = event_parser(lines[i])
    creator,id, timestamp = parsed_event[0],parsed_event[1],parsed_event[4]
    self.events[id] = Event(creator,id, timestamp, self.number_of_nodes)

  # create genesis events
  self.genesis = [Event(i,-1,-1,self.number_of_nodes) for i in range(self.number_of_nodes+1)]

  # make the hashgraph, assign parent,self_parent relationships among the events
  for i in range(1,len(lines)) :
    parsed_event = event_parser(lines[i])
    creator,id, parent , self_parent = parsed_event[0],parsed_event[1],parsed_event[2],parsed_event[3]
    if parent !=-1:
      self.events[id].set_parent(self.events[parent])
      self.events[parent].set_child(self.events[id])

    if self_parent !=-1:
      self.events[id].set_self_parent(self.events[self_parent])
      self.events[self_parent].set_self_child(self.events[id])
    else :
      self.events[id].set_self_parent(self.genesis[creator])
      self.genesis[creator].set_self_child(self.events[id])

  self.consensus_ordered_events = None

  #calls the helper function assign_sequence_number_and_entry_exit_times explained below
  for i in range(1,self.number_of_nodes + 1) :
    self.assign_sequence_number_and_entry_exit_times(self.genesis[i], 0)

  #calls the helper function assign_latest_ancestor explained below
  for event in self.events.values() :
    self.assign_latest_ancestor(event)



# give_topological_order is the helper function which returns the basic topological
# ordering of the event in the DAG Hashgrah. (Note : topological ordering is not the same
# as consensus ordering)
def give_topological_order(self) :
  visited = set()
  order = []
  for event in self.events.values() :
    self.topological_helper(event , visited , order)

  return order



# topological_helper is the helper function for give_topological_order which recurssively
# implements the toplogical sorting algorithm on a DAG.
def topological_helper(self, event, visited, order) :
  if event is None :
    return
  if event.self_parent is None :
    return
  if event.id in visited:
    return
  self.topological_helper(event.parent, visited, order)
  self.topological_helper(event.self_parent, visited , order)

  order.append(event)
  visited.add(event.id)



# assign_latest_ancestor initializes the data structure latest_ancestor_by_creator
# for each event which stores which is the latest event by every creator which is an ancestor
# of that event. It also initializes the data structure knows_fork_by_creator for each event
# which store whether there is fork by a given creator that the current event can see.
# These two helper functions are required for efficient implementation of
# see and strongly_see functions for the HashGraph
def assign_latest_ancestor(self, event):
  if event is None :
    return
  elif event.latest_ancestor_by_creator_assigned :
    return
  else :
    self.assign_latest_ancestor(event.parent)
    self.assign_latest_ancestor(event.self_parent)

  self_parent=event.self_parent
  parent = event.parent

  if self_parent is not None and parent is not None:
    for i in range(1, self.number_of_nodes+1) :
      if parent.knows_fork_by_creator[i] or self_parent.knows_fork_by_creator[i] :
        event.knows_fork_by_creator[i] = True
        break
      latest_ancestor1 = parent.latest_ancestor_by_creator[i]
      latest_ancestor2 = self_parent.latest_ancestor_by_creator[i]
      if latest_ancestor1 is None :
        event.latest_ancestor_by_creator[i] = latest_ancestor2
      elif latest_ancestor2 is None :
        event.latest_ancestor_by_creator[i] = latest_ancestor1
      elif self.is_self_ancestor(latest_ancestor1, latest_ancestor2) :
        event.latest_ancestor_by_creator[i] = latest_ancestor2
      elif self.is_self_ancestor(latest_ancestor2, latest_ancestor1) :
        event.latest_ancestor_by_creator[i] = latest_ancestor1
      else :
        event.knows_fork_by_creator[i]=True

  event.latest_ancestor_by_creator[event.creator] = event
  event.latest_ancestor_by_creator_assigned = True



# assign_sequence_number_and_entry_exit_times performs an euler tour on list of events by
# each creator and assigns enty and exit times for each events in the euler tour.
# using these entry and exit times we can efficiently determine in O(1) operations
# whether an event in self_parent of other event (and whether two events are fork of each other)
def assign_sequence_number_and_entry_exit_times(self, event, time) :
  event.set_entry_time(time)
  time=time+1

  if event.self_parent is None :
    event.set_seq_number(0)
  else :
    event.set_seq_number(event.self_parent.seq_number + 1)

  for self_child in event.self_children :
    time = self.assign_sequence_number_and_entry_exit_times(self_child, time)

  time=time+1
  event.set_exit_time(time)
  return time


