"""## See and Strongly See : The heart of consensus Algorithm"""

# is_self_ancestor determines whether event1 is an self_ancestor of event2 using
# the entry and exit times of the euler tour which was found in the
# assign_sequence_number_and_entry_exit_times helper function
def is_self_ancestor(self, event1, event2) :
  if event1.creator == event2.creator :
    if event1.entry_time <= event2.entry_time and event1.exit_time >= event2.exit_time :
      return True
    return False

  return False



# is_ancestor determines whether event1 is an ancestor of event2
def is_ancestor(self, event1 , event2) :
  visited = set()
  return self.is_ancestor_helper(event1 , event2, visited)



# is_ancestor_helper is the helper function for is_ancestor which recurssively
# determines whether event1 is an ancestor of event2
def is_ancestor_helper(self , event1, event2, visited) :
  visited.add(event2.id)
  if event1.id == event2.id :
    return True
  parent = event2.parent
  if parent is not None and parent.id not in visited :
    if self.is_ancestor_helper(event1 , parent,visited) ==True :
      return True
  self_parent = event2.self_parent
  if self_parent is not None and self_parent.id not in visited :
    if self.is_ancestor_helper(event1, self_parent,visited) ==True :
      return True
  return False



# can_see function determines whether event1 can see event2. Event1 can see
# Event2 if event1 does not know any fork by the creator of event1 and event2
# is ancestor of event1. We use the data structures initalized by helper functions
# previously to determine this in O(1) operations.
def can_see(self, event1, event2) :
  if event1.knows_fork_by_creator[event2.creator] :
    return False

  latest_ancestor = event1.latest_ancestor_by_creator[event2.creator]
  if latest_ancestor is None :
    return False
  elif latest_ancestor.seq_number >= event2.seq_number :
    return True


# can_strongly_see function determines whether event1 strongly sees an event2.
def can_strongly_see(self, event1, event2) :
  if self.can_see(event1 , event2) == False :
    return False

  count = 0
  for i in range(1, self.number_of_nodes+1) :
    if event1.knows_fork_by_creator[event2.creator] :
      continue

    latest_ancestor = event1.latest_ancestor_by_creator[i]
    if latest_ancestor is not None :
      if self.can_see(latest_ancestor, event2) :
        count = count+1
  if(count >= self.majority_number):
    return True
  else :
    return False


