HashGraph.can_strongly_see = can_strongly_see

"""## Divide Rounds : Step 1 of HashGraph Consensus Algorithm"""

# divide_rounds calls the divide_rounds_helper function which recurssively
# assigns round numbers to each event in the HashGraph
def divide_rounds(self) :
  self.witnesses_by_round = {}
  self.max_round_number = 1
  for event in self.events.values() :
    self.divide_rounds_helper(event)

# divide_rounds_helper assigns round number to an event and all its ancestral events
def divide_rounds_helper(self, event) :
  if event.round_number is not None : # if round number already assigned return
    return

  if event.self_parent is None : # if genesis event return
    return
  # if first event(gensis event) assign 1 as the round number and this event is also the first witness event
  elif event.seq_number == 1 :
    event.set_round_number(1)
    event.witness = True
  else :
    # recurssivel assign round number to all ancestral events first
    self.divide_rounds_helper(event.parent)
    self.divide_rounds_helper(event.self_parent)
    r = max(event.parent.round_number, event.self_parent.round_number)
    count = 0

    if self.witnesses_by_round.get(r) is not None :
      for witness in self.witnesses_by_round[r] :
        if self.can_strongly_see(event, witness):
          count=count+1

    # if this event can see more than 2n/3 round r witnesses then assign r+1 as round number
    if count >= self.majority_number :
      event.set_round_number(r+1)
    else :
      event.set_round_number(r)

    # if this is the first event in that round by the creator make the event as witness
    if event.round_number > event.self_parent.round_number :
      event.witness = True

  # store all the witnesses round_wise in a dictionary
  self.max_round_number = max(event.round_number, self.max_round_number)
  if event.witness == True :
    if self.witnesses_by_round.get(event.round_number) is None :
      self.witnesses_by_round[event.round_number] = [event]
    else :
      self.witnesses_by_round[event.round_number].append(event)

HashGraph.divide_rounds = divide_rounds
HashGraph.divide_rounds_helper = divide_rounds_helper

"""## Decide Fame : Step 2 of HashGraph Consensus Algorithm"""

# decide_fame decides the fame of a withness in the HashGraph, it holds the
# electio where other witnesses vote for the fame of other witness.
def decide_fame(self):
  for x_round_number in range(1, self.max_round_number+1) :
    for x in self.witnesses_by_round[x_round_number] :
      votes = {}
      break_from_y_loop = False
      for y_round_number in range(x_round_number+1 , self.max_round_number+1) :
        if break_from_y_loop == True :
          break

        for y in self.witnesses_by_round[y_round_number] :
          d = y.round_number - x.round_number

          # if d is 1, vote for the fame of x based on whether y can see x
          if d == 1:
            vote = self.can_see(y , x)
            if votes.get(y.round_number) is None:
              votes[y.round_number] = []
            votes[y.round_number].append((y,vote))

          else :
            count = 0
            true_votes = 0
            # find the votes of the witnesses in previous round which the
            # witness y can strongly see
            for prev_round_event,vote in votes[y.round_number-1] :
              if(self.can_strongly_see(y, prev_round_event)):
                count = count +1
                if vote == True :
                  true_votes=true_votes+1
            v = False # majority vote in the last round
            t= count - true_votes
            if true_votes >= count-true_votes :
              v = True
              t = true_votes

            if votes.get(y.round_number) is None:
              votes[y.round_number] = []


            # This is a normal round
            if d%10 > 0 :
              # decide fame of x which >2n/3 majority exists
              if t>=self.majority_number :
                x.fame = v
                votes[y.round_number].append((y,v))
                break_from_y_loop = True
                break
              # else carry over the majority vote
              else :
                votes[y.round_number].append((y,v))


            # This is the coin round
            else :
              # carry over the majority vote
              if t>=self.majority_number :
                votes[y.round_number].append((y,v))
              else :
              # do a coin toss and use the middle bit of id as a random bit
                bitId = bin(y.id).replace("0b","")
                if len(bitId)%2==1 :
                  if bitId[len(y.id)//2] == True :
                    votes[y.round_number].append((y,True))
                  else :
                    votes[y.round_number].append((y,False))
                else :
                  if bitId[len(y.id)//2] ^ bitId[len(y.id)//2 - 1]  == True :
                    votes[y.round_number].append((y,True))
                  else :
                    votes[y.round_number].append((y,False))

HashGraph.decide_fame = decide_fame

"""## Find Order : Step 3 of HashGraph Consensus Algorithm"""

# find_order decides the round_recived number and the consensus timestamp for an
# event , this is used to get the consensus ordering on events in the hashgraph
def find_order(self) :
  for x in self.events.values() :
    for r in range(1 , self.max_round_number+1 ) :
      witnesses = self.witnesses_by_round.get(r)

      # check that all witnesses fame in this round has been decided
      undecided_witness = False
      for witness in witnesses :
        if witness.fame is None :
          undecided_witness = True
          break
      if undecided_witness == True :
        break

      # Find which witnesses are unique famous witnesses
      count = [0 for i in range(self.number_of_nodes+1)]
      for witness in witnesses :
        if witness.fame == True:
          count[witness.creator] = count[witness.creator]+1

      # determine if x is the ancestor of every unique famous round r witness
      ancestor_of_every_unique_witness = True
      unique_witnesses = []
      for witness in witnesses :
        if witness.fame == False :
          continue
        elif count[witness.creator] > 1 :
          continue
        else :
          unique_witnesses.append(witness)
          if self.is_ancestor(x , witness)==False :
              ancestor_of_every_unique_witness = False

      # if x is witness of every round r unique famous witness assign its round received as r
      if ancestor_of_every_unique_witness == True :
        x.round_recieved = r
        # find the self-ancestors of unique famous witnesses who heard of event x
        # for the first time
        s=[]
        for unique_witness in unique_witnesses :
          unique_witness_self_ancestor = unique_witness
          while unique_witness_self_ancestor.self_parent is not None :
            if self.is_ancestor(x, unique_witness_self_ancestor.self_parent )==True :
              unique_witness_self_ancestor = unique_witness_self_ancestor.self_parent
            else :
              break
          s.append(unique_witness_self_ancestor)

        # consesnus timestamp of x is the median of timestamps of these events
        s= sorted(s, key = lambda x : x.timestamp)
        if len(s)%2==0 :
          x.consenus_timestamp = (s[len(s)//2].timestamp+s[(len(s)//2)-1].timestamp)/2
        else :
          x.consenus_timestamp =s[len(s)//2].timestamp
        break

  # Establish the consensus ordering for the events who have round-received as decided
  # consesnus order is determined by sorting according to round-received then
  # consensus-timestamp and then the event-id
  round_recived_decided_events = []
  for event in self.events.values() :
    if event.round_recieved is not None :
      round_recived_decided_events.append(event)

  self.consensus_ordered_events = sorted(round_recived_decided_events , key = lambda x : (x.round_recieved, x.consenus_timestamp, x.id))

  return self.consensus_ordered_events

HashGraph.find_order = find_order

"""## The HashGraph_Visualizer Class

The HashGraph_Visualizer Class is used for visualiztion of the HashGraph in graphviz dot language and generating visual output for the graph and also the dot language sourcecode
"""

class HashGraph_Visualizer :
  # initialize the Visualizer Class
  def __init__(self, HashGraph) :
    self.HG = HashGraph
    self.plot_graph()

  # plot_graph generates the Graphviz Graph Object which will contain the dot
  # language source code and can be used to render the visual graph output
  def plot_graph(self) :
    self.dot_graph = graphviz.Digraph()

    order = self.HG.give_topological_order()
    sub = []
    for creator in range(self.HG.number_of_nodes+1):
      sub.append(graphviz.Digraph(graph_attr={'rank':'same'}))

    for genesis in self.HG.genesis:
      for event1 in genesis.self_children :
        for genesis in self.HG.genesis:
          for event2 in genesis.self_children :
            if event2.creator == event1.creator + 1 :
              self.dot_graph.edge(str(event1.id),str(event2.id),dir='none',style='invisible')

    for event in order:
      if event.self_parent.id==-1 :
        self.dot_graph.node(str(event.id),'',shape='circle',group='genesis', color= '#6F7378')
      else :
        self.dot_graph.node(str(event.id),'',shape='circle' ,color= '#6F7378')
      sub[event.creator].node(str(event.id),'',shape='circle')

    for event in order:
      if event.self_parent.id !=-1:
        self.dot_graph.edge(str(event.self_parent.id), str(event.id), dir='none', color= '#6F7378')
      if event.parent!= None:
        self.dot_graph.edge(str(event.parent.id), str(event.id), constraint = 'true', arrowsize = '0.5', color= '#6F7378')




    for subg in sub :
      self.dot_graph.subgraph(subg)

    sub = graphviz.Digraph()
    for genesis in self.HG.genesis:
      for event in genesis.self_children :
        sub.node(str(event.id), group = 'genesis' , color= '#6F7378')

    self.dot_graph.subgraph(sub)

    cmap = ['green','blue','orange','red','purple']
    for event in self.HG.events.values() :
      if event.round_number != None :
        if event.witness == True :
          self.dot_graph.node(str(event.id),shape='doublecircle')

        self.dot_graph.node(str(event.id),color=cmap[event.round_number%5])

    for event in self.HG.events.values() :
      if event.witness == True :
        if event.fame != None :
          if event.fame == True :
            self.dot_graph.node(str(event.id),fillcolor='lightgrey',style='filled')
          else :
            self.dot_graph.node(str(event.id),fillcolor='#6F7378' , style = 'filled')

    if self.HG.consensus_ordered_events != None :
      for i in range(len(self.HG.consensus_ordered_events)-1) :
        #self.dot_graph.edge(str(self.HG.consensus_ordered_events[i].id),str(self.HG.consensus_ordered_events[i+1].id), arrowsize='0.4')
        self.dot_graph.node(str(self.HG.consensus_ordered_events[i].id),label=str(i+1))

  # This creates a file with the name given containing the dot language source code for the graph
  def generate_dot_language_sourcecode_file(self, name) :
    self.plot_graph()
    file = open(name,'w')
    sourcecode = self.dot_graph.source
    file.write(sourcecode)
    file.close()
    print('file {} created with dot langaugae code'.format(name))

  # display_graph_image displays the visual graph as output in google collab cell
  def display_graph_image(self) :
    self.plot_graph()
    graph = graphviz.Source(self.dot_graph)
    display(graph)

  # generate_graph_image_file_as_png generates a png file of the visual graph output
  def generate_graph_image_file_as_png(self, name) :
    self.plot_graph()
    graph = graphviz.Source(self.dot_graph)
    graph.render(name,format = "png")
    print('Image file {}.png created'.format(name))

