input_lines  = get_hashgraph_input(filename)

"""The visualise_consensus_algorithm variable if set to true displays the HashGraph Visual Output after each of the 3 steps of the Consensus Algorithm  """

visualise_consensus_algorithm = True

"""Initialize HashGraph Class and also intialize HashGraph_Visualizer Class.

if visualise_consensus_algorithm is True , a plain Hashgraph visual output is generated
"""

HG = HashGraph(input_lines)
HG_Visualizer = HashGraph_Visualizer(HG)

if visualise_consensus_algorithm == True : # NOTE : Set this to FALSE If You Dont Want Visual outputs in the collab celss
  HG_Visualizer.display_graph_image()

"""Run the Decide Rounds function.

if visualise_consensus_algorithm is True , a HasghGraph output is generated which shows events belonging to different rounds colored in different color.
Also the events which are witness events are shown in the shape of double circle.
"""

HG.divide_rounds()
if visualise_consensus_algorithm == True :
  HG_Visualizer.display_graph_image()

"""Run the Decide Fame function.

if visualise_consensus_algorithm is True , a HasghGraph output is generated.
The Witness events are shown in the shape of double circle, also witnesses which are decided as famous are colored 'lightgrey' while witnesses which are decided are not famous are colored 'darkgrey'. The witnesses which are not colored are witnesses whose fame is undecided.
"""

HG.decide_fame()
if visualise_consensus_algorithm == True :
  HG_Visualizer.display_graph_image()

"""Run the Find Order function.

if visualise_consensus_algorithm is True , a HasghGraph output is generated.
The consensus ordering is shown on the Hashgraph (along with famous/unfamous witnesses and different round events). The number inside the event indicates the order number of that event in the consensus order.  
"""

HG.find_order()
if visualise_consensus_algorithm == True :
  HG_Visualizer.display_graph_image()

"""Generating the output files

1) Consensus Order file

2) Dot sourceCode file for the Final Graph output

3) Png Image for the Final Graph Output
"""

for event in HG.consensus_ordered_events :
  print(event.id,event.round_recieved,event.consenus_timestamp)

name = filename.split('.')[0]
file1 = open(name+'_consensus_order.txt','w')
lines = []
for event in HG.consensus_ordered_events :
  lines.append(str(event.id)+" \n")
lines.append("Done \n")
file1.writelines(lines)
file1.close()
print('file '+name+'_consensus_order.txt created with the given Hashgraph consensus order')

HG_Visualizer.generate_dot_language_sourcecode_file(name+"_graph.dot")
HG_Visualizer.generate_graph_image_file_as_png(name+"_graph_image")

